import "./Login.css"

function Login() {
  return (
    <div className='login'>
        <img className='login__imag' src='https://upload.wikimedia.org/wikipedia/commons/thumb/a/a9/Amazon_logo.svg/1024px-Amazon_logo.svg.png' alt=''/>
    </div>
  )
}

export default Login
